import { Reset, FullScreen, Content } from './styles';

const MainLayout = ({ children }) => (
  <FullScreen>
    <Reset />
    <Content>
      <LogoWrapper>
        <Logo user={user} />
      </LogoWrapper>
      <ChatWrapper>{children}</ChatWrapper>
    </Content>
  </FullScreen>
);

export default MainLayout;
